export default {
    // a* search mode
    AREA_MODE: 16,
    PATH_MODE: 0,

    // path mode
    'random': 0,
    'diagonal': 1,
    'straight': 2,
    'line': 3,
    'A*': 10,
    'A*-random': 11,
    'A*-line': 12,

    // special cost
    'BLOCKER': null,

    // special moving point
    'INFINITY': undefined,
};
